import "./eventList.css";
import useFetch from "../../hooks/userFetch";

const EventList = () => {
  const { data, loading, error } = useFetch("/event/countByType");
  const images = [
    "https://cdn.britannica.com/49/127649-050-31417AF3/Heath-Ledger-Joker-Christian-Bale-The-Dark-Knight-2008.jpg?w=300",
    "https://cdn.britannica.com/49/127649-050-31417AF3/Heath-Ledger-Joker-Christian-Bale-The-Dark-Knight-2008.jpg?w=300",
    "https://cdn.britannica.com/49/127649-050-31417AF3/Heath-Ledger-Joker-Christian-Bale-The-Dark-Knight-2008.jpg?w=300",
    "https://cdn.britannica.com/49/127649-050-31417AF3/Heath-Ledger-Joker-Christian-Bale-The-Dark-Knight-2008.jpg?w=300",
  ];
  return (
    <div className="eList">
      {loading ? (
        "loading"
      ) : (
        <>
          <div id="cards_landscape_wrap-2">
            <div className="container">
              <div className="row"></div>
              {data &&
                images.map((img, i) => (
                  <div className="col-xs-12 col-sm-6 col-md-3 col-lg-3">
                    <a href="">
                      <div className="card-flyer">
                        <div className="text-box">
                          <div className="image-box">
                            <img
                              src="https://cdn.pixabay.com/photo/2018/03/30/15/11/deer-3275594_960_720.jpg"
                              alt=""
                            />
                          </div>
                          <div className="text-container">
                            {/* <h6>Jaipur</h6>
                            <p>{data[2]} College Fests</p> */}
                          </div>
                        </div>
                      </div>
                    </a>
                  </div>
                ))}
            </div>
          </div>
        </>
      )}
    </div>
  );
};
export default EventList;
